import React from 'react';
import Login from './components/Login';
import './index.css';

function App() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 to-slate-700 flex items-center justify-center">
      <Login />
    </div>
  );
}

export default App;
